It must be very exciting and both dangerous to weave through the traffic. Then, do you like to have such adrenalin without any danger? Highway Racer (HR) has been developed as an ambitious game to make you feel this excitement.

You can choose one of the fastest cars which suits you best, and you can change its color, rims, and increase maneuver, acceleration and brake capabilities.
You can get more credits and scores as long as you do not make accident along challenging highway, then you can use this credits to get new cars and modify them.

Game Features:
-You can choose different highways.
-You can play in &quot;one way&quot;, Ã¢â‚¬Å“two way&quot; and &quot;wrong way&quot; modes.
-Game reality is very different from other racing games, there are right-hand, left-hand 
bends, steep ramps and bridges along the road.
-Thanks to Google Play Service, you can see the scores of the other HR racers and you can 
compete with them.
-There are 8 different cars and different color options. You can also make further 
modifications.
-There are options for automatic acceleration and steering with tilt, swipe and touch, etc.

Game Tactics:
-The closer you pass a car the more score you get. 
-The more you drive at high speed the more score you get. 
-The more you drive in opposite direction the more score you get.
-Do not forget to use brake to get rid of accidents.

